import React from 'react';
import { Link } from 'react-router-dom';
import './AdminDashboard.css';  // Import the CSS file for styling

const AdminDashboard = () => {
  return (
    <div className="dashboard">
      <h2>Admin Dashboard</h2>
      
      <div className="dropdown">
        <button className="dropbtn">Admin Actions</button>
        <div className="dropdown-content">
          <Link to="/upload">Add Student</Link>
          <Link to="/view-students">View Students</Link>
          <Link to="/add-menu-item">Add Menu Item</Link>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
